import React from "react";
import Vegetable from "../../assets/Vegatables.jpg";
import Coffee from "../../assets/Coffee.jpg";
import Fruit from "../../assets/Fruite.jpg";
import Masalas from "../../assets/Masalas.jpg";
import Seeds from "../../assets/Seeds.jpg";
import dairy from "../../assets/Dairy.jpg";

function Menu() {
  return (
    <div>
      <div className="flex justify-center space-x-6 mt-10">
        <div className="w-[150px] h-[150px] bg-blue-500 rounded-full flex items-center justify-center text-white border-4 border-transparent hover:border-blue-700 hover:scale-105 transition-all duration-300">
          <img
            className="h-[150px] w-[150px] rounded-full"
            src={Vegetable}
            alt="Vegetable"
          />
        </div>
        <div className="w-[150px] h-[150px] bg-green-500 rounded-full flex items-center justify-center text-white border-4 border-transparent hover:border-green-700 hover:scale-105 transition-all duration-300">
          <img className="h-[150px] w-[150px]" src={Fruit} alt="Fruit" />
        </div>
        <div className="w-[150px] h-[150px] bg-red-500 rounded-full flex items-center justify-center text-white border-4 border-transparent hover:border-red-700 hover:scale-105 transition-all duration-300">
          <img className="h-[150px] w-[150px]" src={dairy} alt="Dairy" />
        </div>
        <div className="w-[150px] h-[150px] bg-yellow-500 rounded-full flex items-center justify-center text-white border-4 border-transparent hover:border-yellow-700 hover:scale-105 transition-all duration-300">
          <img className="h-[150px] w-[150px]" src={Seeds} alt="Seeds" />
        </div>
        <div className="w-[150px] h-[150px] bg-purple-500 rounded-full flex items-center justify-center text-white border-4 border-transparent hover:border-purple-700 hover:scale-105 transition-all duration-300">
          <img className="h-[150px] w-[150px]" src={Masalas} alt="Masalas" />
        </div>
        <div className="w-[150px] h-[150px] bg-orange-500 rounded-full flex items-center justify-center text-white border-4 border-transparent hover:border-orange-700 hover:scale-105 transition-all duration-300">
          <img className="h-[150px] w-[150px]" src={Coffee} alt="Coffee" />
        </div>
      </div>
    </div>
  );
}

export default Menu;
